import React, { Component } from "react";
import { DISHES } from "./shared/Dishes";
import Menu from "./components/Menu";

export default class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      dishes: DISHES
    };
  }


  render() {
    const ChildComponent = () => {
      return (
        <div>
          <p>I am the child</p>
        </div>
      )
    }
    return (
      <div>
        {/* <Menu dishes={this.state.dishes} /> */}

        {ChildComponent}
      </div>
    );
  }
}
